import { Box, Center } from "@mantine/core";
import React from "react";

const Layout2 = ({ selected, setSelected }) => {
  return (
    <Box bg="gray.3" h={200}>
      <Box>
        {selected && (
          <Box
            mt="xs"
            h={60}
            w={60}
            style={{ border: "1px solid #000000" }}
            bg={selected ? "blue.1" : "white"}
          >
            <Center>{selected}</Center>
          </Box>
        )}
      </Box>
    </Box>
  );
};

export default Layout2;
